import React from "react";
import data from "../../data.json";

function Category() {
  return (
    <div className="category">
      <div className="container">
        <div className="row">
          {data.map((item) => (
            <div className="col-lg-4" key={item.id}>
              <img src={item.imageUrl} />
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Category;
